pragma solidity =0.6.6;

//import '@uniswap/v2-core/contracts/interfaces/IUniswapV2Callee.sol';

//import '../libraries/UniswapV2Library.sol';
import './interfaces/V1NEW/IUniswapV1Factory.sol';
import './interfaces/V1NEW/IUniswapV1Exchange.sol';
//import '../interfaces/IUniswapV2Router01.sol';
//import '../interfaces/IERC20.sol';
import './interfaces/IWETH.sol';

import './UniswapV2Library.sol';
import './SushiswapV2Library.sol';
import './interfaces/IUniswapV2Router02.sol';
import './interfaces/IUniswapV2Pair.sol';
import './interfaces/IERC20.sol';

contract FlashSwapV1V2TT {
    IUniswapV1Factory immutable factoryV1;
    address immutable ufactory;
    address immutable sfactory;
    IWETH public constant WETH = IWETH(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2);

    constructor(address _ufactory, address _sfactory, address _factoryV1) public {
        factoryV1 = IUniswapV1Factory(_factoryV1);
        ufactory = _ufactory;
        sfactory = _sfactory;
    }

    // needs to accept ETH from any V1 exchange and WETH. ideally this could be enforced, as in the router,
    // but it's not possible because it requires a call to the v1 factory, which takes too much gas
    receive() external payable {}

    // gets tokens/WETH via a V2 flash swap, swaps for the ETH/tokens on V1, repays V2, and keeps the rest!
    function uniswapV2Call(address sender, uint amount0, uint amount1, bytes calldata data) external {

        address[] memory path = new address[](2);
        uint amountToken;
        uint amountETH;
        (uint flag) = abi.decode(data, (uint));

        //address factory = flag == 0 ? ufactory : sfactory;

        { // scope for token{0,1}, avoids stack too deep errors
        address token0 = IUniswapV2Pair(msg.sender).token0();
        address token1 = IUniswapV2Pair(msg.sender).token1();
        if(flag == 11){
            require(msg.sender == UniswapV2Library.pairFor(ufactory, token0, token1), "Unauthorized From Uniswap"); // ensure that msg.sender is actually a V2 pair
        } else {
            require(msg.sender == SushiswapV2Library.pairFor(sfactory, token0, token1), "Unauthorized From Sushiswap"); // ensure that msg.sender is actually a V2 pair
        }

        assert(amount0 == 0 || amount1 == 0); // this strategy is unidirectional
        path[0] = amount0 == 0 ? token0 : token1;
        path[1] = amount0 == 0 ? token1 : token0;
        amountToken = token0 == address(WETH) ? amount1 : amount0;
        amountETH = token0 == address(WETH) ? amount0 : amount1;
        }

        assert(path[0] == address(WETH) || path[1] == address(WETH)); // this strategy only works with a V2 WETH pair
        IERC20 token = IERC20(path[0] == address(WETH) ? path[1] : path[0]);
        IUniswapV1Exchange exchangeV1 = IUniswapV1Exchange(factoryV1.getExchange(address(token))); // get V1 exchange

        if (amountToken > 0) {
            //(uint minETH) = abi.decode(data, (uint)); // slippage parameter for V1, passed in by caller
            token.approve(address(exchangeV1), uint(-1));
            uint amountReceived = exchangeV1.getTokenToEthInputPrice(amountToken);
            //x = exchangeV1.tokenToEthSwapInput(amountToken, 0, uint(-1));
            //require(x == amountReceived, "NOT GOOD");
            //uint x = WETH.balanceOf(address(this));

            uint amountRequired = flag == 11 ? UniswapV2Library.getAmountsIn(ufactory, amountToken, path)[0] : SushiswapV2Library.getAmountsIn(sfactory, amountToken, path)[0];
            WETH.transfer(msg.sender, amountRequired); // keep the rest! (tokens)

            //y = IERC20(0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2).balanceOf(address(this));
            //WETH.deposit{value: y}();
            require(amountReceived > amountRequired, "NOT GOOD"); 
            WETH.transfer(sender, amountReceived - amountRequired);

        }
    }

    function giveeth() payable external {

        WETH.deposit{value: msg.value}();

    }


    function geteth() external view returns (uint re) {

        re = WETH.balanceOf(address(this));

    }

}
